import React from "react";
import ResultCard from "./ResultCard";

const Results = ({results}) => {
  return(
    <div>
      <h2>Here are your results:</h2>
      {results.forEach(result => {
        <ResultCard title={result.title} />
      })}
    </div>
  );
};

export default Results;
